import React from "react";
import {MDBBtn,MDBTable,MDBTableBody,} from "mdb-react-ui-kit";
import ListGroup from 'react-bootstrap/ListGroup';
import e from "express";

const Filter = (props) => {
  let i=0

    return (
      <>
      { props.searchfilter==='isDone'
            ? props.todos.filter((todo) => {
            return todo.isDone === true;
                 }) .map((todo, i) => {
               return (  
                         <MDBTable className="mb-4">
    <MDBTableBody>
      <tr>
        <th scope="row">{i+1}</th>
        <td>{todo.description}</td>
        <td>In progress</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>
          <MDBBtn type="submit" color="success" className="ms-1">
            Finished
          </MDBBtn>

        </td>
      </tr>

      <tr>
        <th scope="row">2</th>
        <td>Renew car insurance</td>
        <td>In progress</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>

          <MDBBtn type="submit" color="success" className="ms-1">
            Finished
          </MDBBtn>
        </td>
      </tr>

      <tr>
        <th scope="row">3</th>
        <td>Sign up for online course</td>
        <td>In progress</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>

          <MDBBtn type="submit" color="success" className="ms-1">
            Finished
          </MDBBtn>
        </td>
      </tr>

     </MDBTableBody>
                         
                         </MDBTable>
                      );
                    })

                    : props.searchfilter === "Not-Yet" ? props.todos
      .filter((todo) => {
        return todo.isDone === false;
      })
      .map((todo, i) => (
        <ListGroup>
        <ListGroup.Item>
        </ListGroup.Item>
      </ListGroup>
      ))

      
      : props.todos.map((todo, i) => (
        <ListGroup >
        <ListGroup.Item>
        </ListGroup.Item>
      </ListGroup>

             ))

             }
             </>
           );


}
         
export default Filter;
